import React,{useState} from "react";
import { Outlet } from "react-router-dom";
import SideBar from "./SideBar";
function Dashboard() {
  const [modal,setModal]=useState(false);
  return (
    <div className="flex">

      <div className="flex-initial bg-slate-400 h-screen">

        <SideBar />
      </div>

      <div className="flex-initial w-full p-4 justify-around">
      <button onClick={()=>setModal((modal)=>!modal)} className="p-3 hover:text-white fixed hover:bg-sky-900 m-1 rounded-full">
          <svg
            class="w-6 h-6"
            fill="none"
            stroke="currentColor"
            viewBox="0 0 24 24"
            xmlns="http://www.w3.org/2000/svg">
            <path
              stroke-linecap="round"
              stroke-linejoin="round"
              stroke-width="2"
              d="M4 6h16M4 12h16M4 18h16"></path>
          </svg>
        </button>
        {modal?(
      <div className="text-red mt-1 ml-1 h-full w-4/5 m-auto fixed bg-black">
        <button>x</button>
      </div>
     ):null}
        <Outlet />
      </div>
    </div>
  );
}

export default Dashboard;
